FeedPackage.ReleaseNotes:
* Easy mapping members with different names

TinyMapper.Bind<Person, PersonDto>(config =>
{
	config.Bind(source => source.LastName, target => target.Surname);
});

* Ignore `source` member instead of `target` member

TinyMapper.Bind<Person, PersonDto>(config =>
{
	config.Ignore(x => x.Id); // Id from `Person`
});
